	#SELECT @tbname;
	

	SELECT COUNT(Addtime) INTO `@datanum` FROM hisirdata WHERE DATE_FORMAT(Addtime ,'%Y-%m-%d') = DATE_FORMAT(`@addtime`,'%Y-%m-%d');
	#SELECT `@datanum`;
	IF `@datanum`>0 THEN
	SET @sqlstr1=CONCAT('DROP TABLE IF EXISTS ',@tbname);
	PREPARE stmt1 FROM @sqlstr1;
	EXECUTE stmt1;
	SET @sqlstr2=CONCAT('CREATE TABLE ',@tbname,' LIKE hisirdata');
	PREPARE stmt2 FROM @sqlstr2;
	EXECUTE stmt2;
	SET @sqlstr3=CONCAT('INSERT INTO ',@tbname,' SELECT * FROM hisirdata WHERE DATE_FORMAT(Addtime ,''%Y-%m-%d'')=DATE_FORMAT(''',`@addtime`,''',''%Y-%m-%d'')');
	PREPARE stmt3 FROM @sqlstr3;
	EXECUTE stmt3;
	DELETE FROM hisirdata WHERE DATE_FORMAT(Addtime ,'%Y-%m-%d') = DATE_FORMAT(`@addtime`,'%Y-%m-%d');
	END IF;
END
;;
